import React from 'react';
import {
  Container,
  Row,
  Col,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText
} from 'reactstrap';
import './Login.css';
import '../../App.css';
const Login = () => {
  return (
    <div className='cont'>
      <Container fluid>
        <div className='loginBox'>
          <section dir='rtl' className='container '>
            <h1 className='large text-primary  text-center'>התחברות</h1>
            <p className='lead text-center' dir='rtl'>
              <i className='fas fa-user'></i> בחר סיסמא בעלת 6 תווים או יותר
            </p>
            <Form dir='rtl' className='form' action='dashboard.html'>
              <FormGroup>
                <Input
                  type='password'
                  placeholder='כתובת מייל'
                  name='password'
                  //onChange={e => onPasswordChange(e)}
                  required
                />
              </FormGroup>
              <FormGroup>
                <Input
                  type='password'
                  placeholder='סיסמא'
                  name='confirmPassword'
                  //  onChange={e => onConfirmPasswordChange(e)}
                />
              </FormGroup>
              <Input
                type='submit'
                //onClick={e => passwordHandler(e)}
                className='btn btn-primary'
                value='Login'
              />
            </Form>
            <p className='my-1'>
              Don't have an account? <a href='register.html'>Sign Up</a>
            </p>
          </section>
        </div>
      </Container>
    </div>
  );
};

export default Login;
